    html {
        --red: #ff0000;
        --black: #393939;
        --grey: #3a3a3a
        --gray: var(--grey);
        --lightGrey: #e1e1e1;
        --lightGray: var(--lightGrey);
        --offWhite: #ededed;
        --maxWidth: 1000px;
        --bs: '0 12px 24px '
    }



`;

export default function Page({children}) {
    return (
        <div>
            <Header ></Header>
            <h2>Ich bin ein seite</h2>
            {children}
        </div>
    );
}

Page.propTypes = {
    children: PropTypes.any,
}
